import React, { useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { useNavigate } from 'react-router-dom';

function genId() {
    var id = "";
    for(let i = 0; i < 10; i++) {
        const rnd = Math.random(1, 100);
        id += String.fromCharCode(rnd);
    }
    return id;
}

const Create = () => {
  const [name, setName] = useState('');
  const [selectedDate, setSelectedDate] = useState(null);

  const handleInputChange = (e) => {
    setName(e.target.value);
  };

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    /*
    generate new id, create a mapping from id to title/date, navigate to edit/id

    */
    const newId = genId();

  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Title:</label>
        <input type="text" value={name} onChange={handleInputChange}></input>
      </div>
      <div>
        <label>Date:</label>
        <DatePicker selected={selectedDate} onChange={handleDateChange} required="true"/>
      </div>
      <button type="submit">Submit</button>
    </form>
  );
}

export default Create;
